import './App.css';
import './index.scss';
import 'bootstrap/dist/css/bootstrap.min.css';
import LoginForm from './components/LoginForm';
import ServerList from './components/ServerList';

function App() {
  return (
    <div className="App">
      <div class="container">
        <div class="row">
          <div class="col-md-4 mx-auto">
            <LoginForm></LoginForm>
          </div>
        </div>
    </div>
      <ServerList></ServerList>
    </div>
  );
}

export default App;
